(function(_,Modernizr,PhotoSwipe,PhotoSwipeUI_Default){"use strict";window.addEventListener("load",function(e){var script=document.getElementById("dlgallery");if(!script){return}var list=JSON.parse(document.getElementById("dlgallery").innerText);if(_.isEmpty(list)){return}var jumbotron=document.getElementsByClassName("dljumbotron");if(!jumbotron.length){return}jumbotron=jumbotron[0];var a=document.createElement("a");a.classList.add("dljumbotron-gallery-wrapper");a.setAttribute("href","#");jumbotron.parentElement.insertBefore(a,jumbotron);a.appendChild(jumbotron);var dataLabel=jumbotron.getAttribute("data-gallerylabel"),container=document.querySelector(".dljumbotron");if(dataLabel&&container){var iconLabel=document.createElement("span");iconLabel.classList.add("dljumbotron-gallery-label");dataLabel=dataLabel.split(":");var iconClass=dataLabel[1].split(",");iconLabel.innerHTML='<i class="'+iconClass.join(" ")+'" aria-hidden="true"></i>'+dataLabel[0];container.insertBefore(iconLabel,container.firstElementChild)}var pswp=document.getElementsByClassName("pswp");if(!pswp.length){return}pswp=pswp[0];var options={index:0,shareButtons:false,shareEl:false};a.addEventListener("click",function(evt){evt.preventDefault();evt.stopImmediatePropagation();var gallery=new PhotoSwipe(pswp,PhotoSwipeUI_Default,list,options);gallery.init()})})})(_,Modernizr,PhotoSwipe,PhotoSwipeUI_Default);